import React from 'react';

const GlobalTechGreenSpark = props => {
	const { size } = props;
	const width = (isFinite(size) && size) || 32;
	const height = width * 1.13;

	return (
		<svg
			version="1.1"
			xmlns="http://www.w3.org/2000/svg"
			width={`${width}px`}
			height={`${height}px`}
			viewBox={`0 0 ${width} ${height}`}
		>
			<title>GlobalTech_Spark_green</title>
			<g
				id="GlobalTech_Spark_green-1"
				stroke="none"
				strokeWidth="1"
				fill="none"
				fillRule="evenodd"
			>
				<image
					id="GlobalTech_Spark_green"
					x="0"
					y="0"
					width={width}
					height={height}
					href="data:image/png;base64,"
				/>
			</g>
		</svg>
	);
};

export default GlobalTechGreenSpark;
